import { OktaAuth } from '@okta/okta-auth-js';

const oktaConfig = {
  issuer: 'https://dev-32617710.okta.com/oauth2/default',
  clientId: '0oab13mt0oKO5ozPi5d7',
  redirectUri: window.location.origin + '/implicit/callback',
};

export default oktaConfig;
